import React, { Component } from 'react';

import TaskList from './TaskList';

export default class Card extends Component {
    render() {
        return(
            <div className="Card">
                <h3>{this.props.cardTitle}</h3>
                <span>{this.props.description}</span>
                <TaskList tasks={this.props.cards}/>
            </div>
        )
    }
}
